import { useState } from "react";
import useLoaded from "../utils/Loaded";

const { MongoClient } = require('mongodb');

function Other() {

    const [ text, setText ] = useState("LOL")

    let loadedRender = () => { return <p>{text}</p> }

    const [ setIsLoaded, render ] = useLoaded(loadedRender)

    const url = "mongodb+srv://botroot:Lemazal7@cluster0.f0fh7.mongodb.net?retryWrites=true&w=majority";
    MongoClient.connect(url, { useNewUrlParser: true, useUnifiedTopology: true }).then(client => {
        const collection = client.db("ComanBase").collection("config");
        setIsLoaded(true);
        setText(collection.count({}));
        client.close();
    });

    return render();


}

export default Other;
